import React from 'react';
import { Outlet } from 'react-router-dom';
import Header from './Header';
import Footer from './Footer';

const Layout = () => {
  return (
    <>
      <Header className="header-container"/>
      <main class>
        <Outlet />
      </main>
      <Footer className="footer-container"/>
    </>
  );
};

export default Layout;
